INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (1,"Le Moyen-âge pour quoi faire ?","Le pré est vénéneux mais joli en automne -Les vaches y paissant lentement s'empoisonnent -Les colchiques couleur de cerne et de lilas. Y fleurit tes yeux sont comme cette fleur-là -Violâtres comme leur cerne et comme cet automne#Guillaume Apollinaire","20170510");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (2,"L'ethique protestante et l'esprit du capitalisme","Les raisons d'aimer et de vivre varient comme font les saisons.#Louis Aragon","20180211");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (3,"Le Bruit et la fureur","Je suis plein du silence assourdissant d'aimer.#Louis Aragon","20170119");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (4,"La Ferme Des Animaux (French Edition) (Folio)","Je vous dis que l’homme est né pour la femme et né pour l’amour.#Louis Aragon","20171230");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (5,"Citoyen de la galaxie","L'amour, c'est être toujours inquiet de l'autre.#Marcel Achard","20180922");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (6,"Etoiles, garde à vous!","Quand on aime quelqu'un, on a toujours quelque chose à lui dire ou à lui écrire, jusqu'à la fin des temps.#Christian Bobin","20180609");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (7,"Dune","L'amour, c'est quand quelqu'un se met à vous parler comme une rivière, comme une étoile, ou comme la fleur du chèvrefeuille...#Christian Bobin","20170130");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (8,"Révolte sur la lune (Imaginaire) (French Edition)","Chaque minute loin de l'être aimé est une minute cédée au néant#François Bégaudeau","20180831");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (9,"L'Homme unidimensionnel: Essai sur l'idéologie de la société industrielle avancée","Dans l'amour d'un couple, trouver la distance juste est essentiel. Cela demande beaucoup de patience, de perspicacité et d'imagination, en un mot, d'esprit.#Jacques de Bourbon Busset","20180915");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (10,"Un bonheur insoutsecurity_user_enable","Le verbe aimer est difficile à conjuguer : son passé n'est pas simple, son présent n'est qu'indicatif, et son futur est toujours conditionnel.#Jean Cocteau","20170719");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (11,"La Reproduction : éléments d'une théorie du système d'enseignement","Sans te chercher, je te trouve de tous les côtés, principalement quand je ferme les yeux...#Julio Cortazar","20170507");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (12,"Cuba Est-Il Socialiste?","L'amour plaît plus que le mariage, par la raison que les romans sont plus amusants que l'histoire.#Nicolas Chamfort","20180704");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (13,"Mythologies: The Complete Edition, in a New Translation","Les yeux dans les yeux, il prit son sourire et le lui rendit.#Paul Claudel","20180417");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (14,"Energie et équité","J'ai tant rêvé de toi que tu perds ta réalité.#Robert Desnos","20170903");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (15,"Travailler deux heures par jour","La courbe de tes yeux fait le tour de mon cœur.#Paul Éluard","20180201");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (16,"Le principe responsabilité","L’amour est comme l’opéra, on s’y ennuie, mais on y retourne.#Gustave Flaubert","20170128");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (17,"La révolution du temps choisi (French Edition)","L'homme commence par aimer l'amour et finit par aimer une femme. La femme commence par aimer un homme et finit par aimer l'amour.#Remy de Gourmont","20170705");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (18,"Sociologie politique du sport (Collection Forum de l'I.F.R.A.S) (French Edition)","Un très grand amour, ce sont deux rêves qui se rencontrent et, complices, échappent jusqu'au bout à la réalité.#Romain Gary","20170911");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (19,"L'homme qui prenait sa femme pour un chapeau : Et autres récits cliniques [ The Man Who Mistook His Wife For A Hat: And Other Clinical Tales ] (French Edition)","L'amour, c'est comme un papillon : il est hors de portée quand on le chasse, mais si on le laisse tranquille, il peut très bien venir se poser sur votre épaule.#Nathaniel Hawthorne","20180211");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (20,"Les identites meurtrieres (French Edition)","Aimer, c'est savoir dire je t'aime sans parler.#Victor Hugo","20170313");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (21,"La domination masculine","Le premier symptôme de l'amour vrai chez un jeune homme, c'est la timidité, chez une jeune fille, c'est la hardiesse.#Victor Hugo","20180729");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (22,"La découverte de la lenteur","Aimer, c'est la moitié de croire.#Victor Hugo","20180730");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (23,"La gauche imaginaire et le nouveau capitalisme","Aimons-nous des êtres réels, ou bien l'opinion que nous nous faisons d'eux ?#Alexandre Jardin","20180722");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (24,"Le nouvel esprit du capitalisme","Vous m'avez regardé avec toute votre âme. Vous m'avez regardé longtemps comme un ciel bleu. J'ai mis votre regard à l'ombre de mes yeux... Que ce regard était passionné et calme...#Francis Jammes","20170901");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (25,"Les sept savoirs nécessaires à l'éducation du futur","Aimer, c'est n'avoir plus droit au soleil de tout le monde. On a le sien.#Marcel Jouhandeau","20180318");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (26,"Sport et civilisation : histoire et critique d'un phe nome ne social de masse","Aimer, c'est se réjouir du bonheur d'un autre.#Gottfried Wilhelm Leibniz","20180906");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (27,"Manuel de typographie franse mentaire","Tout peut s'en aller à vau-l'eau dans ce monde, sauf l'amour. L'amour ne peut pas faiblir. S'il trébuche en chemin et s'effondre comme une chiffe, c'est que ce n'était pas de l'amour.#Jack London","20180805");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (28,"Historiquement correct : pour en finir avec le passe unique","Il arrive quelquefois qu'une femme cache à un homme toute la passion qu'elle sent pour lui, pendant que de son côté il feint pour elle toute celle qu'il ne sent pas.#Jean de La Bruyère","20171116");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (29,"Un anthropologue sur Mars","Je ne sais où va mon chemin mais je marche mieux quand ma main serre la tienne.#Alfred de Musset","20170421");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (30,"La ville franchisée : formes et structures de la ville contemporaine","Ne laissez personne venir à vous et repartir sans être plus heureux.#Mère Teresa","20180830");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (31,"Généalogie du génocide rwandais","Ce qui se fait par amour se fait toujours par-delà le bien et le mal.#Friedrich Nietzsche","20170721");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (32,"Oeuvres comple tes","Plus j'avance en âge et plus je suis convaincu qu'il y a deux choses essentielles dans la vie à ne pas rater : aimer et mourir.#Abbé Pierre","20180212");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (33,"Le sida","Le cœur a ses raisons que la raison ne connaît pas.#Blaise Pascal","20170815");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (34,"Foules intelligentes la nouvelle rlution sociale","À force de parler d'amour, on devient amoureux, il n'y a rien de si aisé. C'est la passion la plus naturelle de l'homme.#Blaise Pascal","20170829");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (35,"La condition littéraire","L'amour est nu comme la main.#Jacques Prévert","20180404");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (36,"Ecologie et liberté : Bernard Charbonneau précuseur de l'écologie politique","Aimer, ce n'est point se regarder l'un l'autre, mais regarder ensemble dans la même direction.#Antoine de Saint-Exupéry","20171222");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (37,"Introduction à Castoriadis","L'amour véritable est un don, pur, mais un don de chacun à l'autre dans le respect de ce qu'il a encore à donner.#Antoine de Saint-Exupéry","20170816");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (38,"Le plan B : Pour un pacte écologique mondial","Le paradis, c'est la fusion de deux âmes dans un baiser d'amour...#George Sand","20170101");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (39,"2030 : Le krach écologique","Et, dans son essence, le projet de se faire aimer.#Jean-Paul Sartre","20180514");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (40,"Changer le monde sans prendre le pouvoir : Le sens de la révolution aujourd'hui","Aimer est, dans son essence, le projet de se faire aimer.#Jean-Paul Sartre","20180515");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (41,"Rendre la réalité inacceptable","La mesure de l'amour, c'est d'aimer sans mesure.#Saint Augustin","20170426");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (42,"Chagrin d'école - Prix Renaudot 2007","Aime, et ce que tu veux, fais-le ! Si tu te tais, tais-toi par amour ; si tu parles, parle par amour ; si tu corriges, corrige par amour ; si tu pardonnes, pardonne par amour..#Saint Augustin","20180301");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (43,"Responsabilité et jugement","Aimer, c'est avoir du plaisir à voir, toucher, sentir par tous les sens, et d'aussi près que possible un objet aimable et qui nous aime.#Stendhal","20170821");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (44,"L'Esprit de Philadelphie. La justice sociale face au marché total","L'amour ne regarde pas avec les yeux, mais avec l'âme.#William Shakespeare","20170213");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (45,"La Démocratie Internet. Promesses et limites","Dans l'amour entre l'homme et la femme, il y a toujours une minute où cet amour atteint son plus haut degré, où il n'a plus rien de réfléchi ni rien de sensuel, où il est l'entière union de deux êtres en un seul.#Léon Tolstoï","20170707");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (46,"Accélération","L'homme veut être le premier amour de la femme, alors que la femme veut être le dernier amour de l'homme.#Oscar Wilde","20180804");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (47,"L'Avenir est notre poubelle: L'alternative de la décroissance","Aimer un être, c'est tout simplement reconnaître qu'il existe autant que vous.#Simone Weil","20171204");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (48,"Divertir pour dominer : La culture de masse contre les peuples","On ne peut ni raisonner ni prévoir au sujet du bonheur : il faut l'avoir maintenant. Quand il paraît être dans l'avenir, songez-y bien, c'est que vous l'avez déjà. Espérer, c'est être heureux.#Alain","20180518");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (49,"La révolution libertaire : Proudhon, Bakounine, Kropotkine","L'homme n'est heureux que de vouloir et d'inventer.#Alain","20171222");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (50,"Manuel de transition","Il y a plus de volonté qu'on ne croit dans le bonheur.#Alain","20180308");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (51,"Footafric : Coupe du monde, capitalisme et néocolonialisme","L'effort qu'on fait pour être heureux n'est jamais perdu.#Alain","20170226");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (52,"Désobéir au nucléaire","C'est plein de disputes, un bonheur.#Jean Anouilh","20180719");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (53,"Pour une révolution fiscale. Un impôt sur le revenu pour le XXIe siècle","La seule façon d’être heureux c’est d’aimer souffrir.#Woody Allen","20170119");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (54,"Le socialisme sans le progrès","Pour être heureux, il faut penser au bonheur d'un autre.#Gaston Bachelard","20170627");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (55,"La Voie: Pour l'avenir de l'humanité","Être capable de trouver sa joie dans la joie de l'autre : voilà le secret du bonheur.#Georges Bernanos","20180114");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (56,"Einkommen für alle","Le bonheur est une bulle de savon qui change de couleur comme l'iris et qui éclate quand on la touche.#Honoré de Balzac","20170506");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (57,"Le complexe d'Orphée : La Gauche, les gens ordinaires et la religion du progrès","Le secret du bonheur et le comble de l'art, c'est de vivre comme tout le monde, en n'étant comme personne.#Simone de Beauvoir","20180122");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (58,"La décroissance heureuse : La qualité de vie ne dépend pas du PIB","Il y a autant de manières d'être heureux qu'il y a d'individus.#Denis Diderot","20180425");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (59,"TV Lobotomie : La vérité scientifique sur les effets de la télévision","L'homme le plus heureux est celui qui fait le bonheur d'un plus grand nombre d'autres.#Denis Diderot","20180313");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (60,"Techno : Le son de la technopole","Il n'y a qu'une route vers le bonheur, c'est de renoncer aux choses qui ne dépendent pas de notre volonté.#Epictète","20170912");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (61,"Le Grand Massacre des chats: Attitudes et croyances dans l'Ancienne France","Il ne dépend pas de toi d'être riche, mais il dépend de toi d'être heureux.#Epictète","20171112");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (62,"L'enfer vert, un projet pavé de bonnes intentions : Suivi de Critique de la planification écologique","Être heureux, c'est savoir se contenter de peu.#Epicure","20180709");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (63,"L'empire de l'illusion : La mort de la culture et le triomphe du spectacle","Les hommes veulent tout avoir, et ils se rendent malheureux par le désir du superflu ; s'ils voulaient vivre simplement et se contenter de satisfaire aux vrais besoins, on verrait partout l'abondance, la joie, la paix.#Fénelon","20180614");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (64,"Thermodynamique de l'évolution : Un essai de thermo-bio-sociologie","Nous ne sommes jamais vraiment heureux si nous n'essayons pas d'éclairer la vie des autres.#Helen Keller","20170712");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (65,"Générations Ellul: 60 héritiers de la pensée de Jacques Ellul","Le bonheur n'est pas un événement, c'est une aptitude.#François de La Rochefoucauld","20170610");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (66,"Aliénation et accélération","Il faut rire avant d'être heureux, de peur de mourir sans avoir ri.#Jean de La Bruyère","20180510");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (67,"L'Apocalypse joyeuse. Une histoire du risque technologique","Il n'y a point de chemin vers le bonheur. Le bonheur, c'est le chemin.#Lao-Tse","20170904");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (68,"Le cauchemar pavillonnaire","L'homme content de son sort ne connaît pas la ruine.#Lao-Tse","20180510");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (69,"Crack Capitalism : 33 thèses contre le capital","Chacun cherche sa route ; nous cherchons la nôtre et nous pensons que le jour où le règne de la liberté et de l'égalité sera arrivé, le genre humain sera heureux.#Louise Michel","20180416");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (70,"Les marchands de doute : Ou comment une poignée de scientifiques ont masqué la vérité sur des enjeux de société tels que le tabagisme et le réchauffement climatique","On est heureux quand on a dépassé l'inquiétude du bonheur.#Maurice Maeterlinck","20170809");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (71,"La décroissance","Ne laissez personne venir à vous et repartir sans être plus heureux.#Mère Teresa","20171209");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (72,"Qu'est-ce que la propriété ?","Si on ne voulait qu'être heureux, cela serait bientôt fait. Mais on veut être plus heureux que les autres et cela est presque toujours difficile parce que nous croyons les autres plus heureux qu'ils ne sont.#Montesquieu","20170103");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (73,"L'entraide : Un facteur de l'évolution","J'ai reconnu le bonheur au bruit qu'il a fait en partant.#Jacques Prévert","20170909");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (74,"La Métamorphose","Tout homme veut être heureux ; mais, pour parvenir à l'être, il faudrait commencer par savoir ce que c'est que le bonheur.#Jean-Jacques Rousseau","20180605");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (75,"Le Cycle de Mars (01)","Je ne désire rien du passé. Je ne compte plus sur l'avenir. Le présent me suffit. Je suis un homme heureux, car j'ai renoncé au bonheur.#Jules Renard","20180721");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (76,"Cahiers de prison 1,2,3,4 et 5","Le but, c'est d'être heureux. On n'y arrive que lentement. Il y faut une application quotidienne. Quand on l'est, il reste beaucoup à faire : à consoler les autres.#Jules Renard","20171101");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (77,"Technique et civilisation","Le bonheur est, en quelque sorte, ce qui met un point d'arrêt à la fuite en avant du désir.#Paul Ricoeur","20170913");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (78,"Théorie de la folie des masses","Il y a qu'une erreur innée : celle qui consiste à croire que nous existons pour être heureux.#Arthur Schopenhauer","20180908");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (79,"Conan le cimmérien","Le bonheur, c'est de continuer à désirer ce qu'on possède.#Saint Augustin","20170211");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (80,"Le mythe de Sisyphe","On ne peut être heureux quand on ne vit que pour soi, quand on rapporte tout à son propre intérêt. On ne vit vraiment pour soi qu’en vivant pour un autre.#Sénèque","20180502");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (81,"La vingt-cinquième heure","La vie heureuse, est celle qui est en accord avec sa propre nature.#Sénèque","20180921");
