INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (272,"L'Esprit de Philadelphie. La justice sociale face au marché total","Le courage nourrit les guerres, mais c'est la peur qui les fait naître.#Alain","20180426");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (273,"La Démocratie Internet. Promesses et limites","C’est l’ignorance, et non la connaissance, qui dresse les hommes les uns contre les autres.#Kofi Annan","20170424");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (274,"Accélération","La guerre ! C'est une chose trop grave pour la confier à des militaires.#Georges Clémenceau","20180830");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (275,"L'Avenir est notre poubelle: L'alternative de la décroissance","Je ne sais pas comment sera la troisième guerre mondiale, mais je sais qu'il n'y aura plus beaucoup de monde pour voir la quatrième.#Albert Einstein","20170805");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (276,"Divertir pour dominer : La culture de masse contre les peuples","Dans la paix, les fils ensevelissent leur père ; dans la guerre, les pères ensevelissent leurs fils.#Hérodote","20180415");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (277,"La révolution libertaire : Proudhon, Bakounine, Kropotkine","La première victime d'une guerre, c'est la vérité.#Rudyard Kipling","20170804");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (278,"Manuel de transition","Si on part du principe que la vie vaut d'être vécue, que l'humanité a le droit de survivre, il faut trouver une alternative à la guerre.#Martin Luther King","20170104");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (279,"Footafric : Coupe du monde, capitalisme et néocolonialisme","La politique est une guerre sans effusion de sang et la guerre une politique avec effusion de sang.#Mao-Tsé-Toung","20180402");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (280,"Désobéir au nucléaire","On fait la guerre quand on veut, on la termine quand on peut.#Nicolas Machiavel","20170911");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (281,"Pour une révolution fiscale. Un impôt sur le revenu pour le XXIe siècle","Vous devez donc savoir qu'il y a deux manières de combattre, l'une avec des lois, l'autre avec la force. La première est propre aux hommes, l'autre nous est commune avec les bêtes.#Nicolas Machiavel","20170313");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (282,"Le socialisme sans le progrès","Les vrais vaincus de la guerre, ce sont les morts.#Ernest Renan","20170521");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (283,"La Voie: Pour l'avenir de l'humanité","La guerre n'est pas une aventure. La guerre est une maladie. Comme le typhus.#Antoine de Saint-Exupéry","20180122");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (284,"Einkommen für alle","Il suffit qu'un seul homme en haïsse un autre pour que la haine gagne de proche en proche l'humanité entière.#Jean-Paul Sartre","20170909");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (285,"Le complexe d'Orphée : La Gauche, les gens ordinaires et la religion du progrès","Quand les riches se font la guerre, ce sont les pauvres qui meurent.#Jean-Paul Sartre","20170922");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (286,"La décroissance heureuse : La qualité de vie ne dépend pas du PIB","Se préparer à la guerre est le meilleur moyen de préserver la paix.#George Washington","20170131");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (287,"TV Lobotomie : La vérité scientifique sur les effets de la télévision","L'avenir de l'humanité reste indéterminé parce qu'il dépend d'elle.#Henri Bergson","20170411");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (288,"Techno : Le son de la technopole","Toute l'humanité est impliquée dans un processus simple, et tous les hommes sont frères. Quand je fais du mal à mon frère, quoi qu'il me fasse, je me fais autant de mal à moi-même.#Martin Luther King","20180411");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (289,"Le Grand Massacre des chats: Attitudes et croyances dans l'Ancienne France","Je tremble toujours qu'on ne parvienne, à la fin, à découvrir quelque secret qui fournisse une voie plus abrégée pour faire périr les hommes, détruire les peuples et les nations entières.#Montesquieu","20180622");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (290,"L'enfer vert, un projet pavé de bonnes intentions : Suivi de Critique de la planification écologique","Je pense que l'humanité n'est pas nécessairement la favorite de la nature, que l'humanité peut très bien disparaître, que nous ne sommes pas une espèce sacrée#Hubert Reeves","20170327");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (291,"L'empire de l'illusion : La mort de la culture et le triomphe du spectacle","L'avantage d'être intelligent, c'est qu'on peut toujours faire l'imbécile, alors que l'inverse est totalement impossible.#Woody Allen","20180518");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (292,"Thermodynamique de l'évolution : Un essai de thermo-bio-sociologie","Rien n'existe dans notre intelligence qui n'ait d'abord été dans nos sens.#Démocrite","20180209");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (293,"Générations Ellul: 60 héritiers de la pensée de Jacques Ellul","Les maîtres d'école sont des jardiniers en intelligences humaines.#Victor Hugo","20171016");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (294,"Aliénation et accélération","On mesure l'intelligence d'un individu à la quantité d'incertitudes qu'il est capable de supporter.#Emmanuel Kant","20170113");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (295,"L'Apocalypse joyeuse. Une histoire du risque technologique","L'intelligence est la faculté à l'aide de laquelle nous comprenons finalement que tout est incompréhensible.#Claude Lévi-Strauss","20170816");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (296,"Le cauchemar pavillonnaire","Celui qui en sait beaucoup sur les autres est peut-être instruit, mais celui qui se comprend lui-même est plus intelligent.#Lao-Tseu","20170503");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (297,"Crack Capitalism : 33 thèses contre le capital","L'hésitation est le propre de l'intelligence.#Henri de Montherlant","20171204");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (298,"Les marchands de doute : Ou comment une poignée de scientifiques ont masqué la vérité sur des enjeux de société tels que le tabagisme et le réchauffement climatique","L'intelligence ne vaut qu'au service de l'amour.#Antoine de Saint-Exupéry","20170105");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (299,"La décroissance","Le malheur avec un type intelligent, c'est qu'il n'est jamais assez intelligent pour ne pas se dire qu'il est le plus intelligent.#Boris Vian","20170714");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (300,"Qu'est-ce que la propriété ?","Si l'homme échoue à concilier la justice et la liberté, alors il échoue à tout.#Albert Camus","20180910");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (301,"L'entraide : Un facteur de l'évolution","Rendez le bien pour le bien et la justice pour le mal.#Confucius","20171219");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (302,"La Métamorphose","Il est effrayant de penser que cette chose qu'on a en soi, le jugement, n'est pas la justice. Le jugement, c'est le relatif. La justice, c'est l'absolu. Réfléchissez à la différence entre un juge et juste.#Victor Hugo","20170107");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (303,"Le Cycle de Mars (01)","Une injustice commise quelque part est une menace pour la justice dans le monde entier.#Martin Luther King","20180512");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (304,"Cahiers de prison 1,2,3,4 et 5","Il n'y a point de plus cruelle tyrannie que celle que l'on exerce à l'ombre des lois et avec les couleurs de la justice.#Montesquieu","20170204");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (305,"Technique et civilisation","Un acte de justice et de douceur a souvent plus de pouvoir sur le coeur des hommes que la violence et la barbarie.#Nicolas Machiavel","20170720");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (306,"Théorie de la folie des masses","L'affection ou la haine change la justice de face. Et combien un avocat bien payé par avance trouve-t-il plus juste la cause qu'il plaide ! #Blaise Pascal","20180831");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (307,"Conan le cimmérien","Le bon juge ne sera pas un jeune homme, il faut qu'il soit vieux et qu'il ait acquis une connaissance de l'injustice.#Platon","20170503");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (308,"Le mythe de Sisyphe","La justice de l'intelligence est la sagesse. Le sage n'est pas celui qui sait beaucoup de choses, mais celui qui voit leur juste mesure.#Platon","20180830");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (309,"La vingt-cinquième heure","Où il n'y a point de justice, il n'y a point de république.#Saint Augustin","20180804");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (310,"Fahrenheit 451","Il vaut mieux hasarder de sauver un coupable que de condamner un innocent.#Voltaire","20171206");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (311,"La technique, ou, L'enjeu du siècle","Il a fallu des siècles pour rendre justice à l'humanité, pour sentir qu'il est horrible que le grand nombre semât et que le petit nombre recueillît.#Voltaire","20180702");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (312,"Tistou les pouces verts","Le cœur d'une mère est un abîme au fond duquel se trouve toujours un pardon.#Honoré de Balzac","20180127");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (313,"Hiroshima est partout","L'asile le plus sûr est le sein d'une mère.#Jean-Pierre Claris de Florian","20180317");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (314,"L'avenir commence demain","Avec l'amour maternel, la vie nous a fait à l'aube une promesse qu'elle ne tient jamais.#Romain Gary","20171210");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (315,"La crise de la culture","O l'amour d'une mère ! Amour que nul n'oublie ! Pain merveilleux qu'un dieu partage et multiplie !#Victor Hugo","20170826");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (316,"La cité à travers l'histoire","Quand on est bonne mère, on sait tout pardonner.#Emile Zola","20170209");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (317,"Le retour du tragique","Mourir, ce n'est rien. Commence donc par vivre. C'est moins drôle et c'est plus long#Jean Anouilh","20180920");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (318,"L'Invention dans les techniques. Cours et conférences","Ce n'est pas que j'aie vraiment peur de mourir, mais je préfère ne pas être là quand ça arrivera.#Woody Allen","20171004");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (319,"Notes critiques (1949-1969) : Sur le temps présent","Pour mes obsèques, je ne veux que le strict nécessaire, c'est-à-dire moi.#Georges Clémenceau","20180425");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (320,"L'Empire des signes","La mort ne m'aura pas vivant.#Jean Cocteau","20170929");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (321,"Les veines ouvertes de l'Amérique latine","Qui ne craint point la mort ne craint point les menaces.#Pierre Corneille","20180711");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (322,"Esquisse d'une théorie de la pratique. précédé de","L'homme naît sans dents, sans cheveux et sans illusions, et il meurt de même, sans cheveux, sans dents et sans illusions.#Alexandre Dumas","20170522");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (323,"La convivialité","La vie est une aventure, elle doit être sans cesse disputée à la mort.#Albert Einstein","20170813");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (324,"Une société à la dérive. Entretiens et débats 1974","Ne sais-tu pas que la source de toutes les misères de l'homme, ce n'est pas la mort, mais la crainte de la mort ?#Epictète","20171208");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (325,"Le Silmarillion","Chacun de nous quitte la vie avec le sentiment qu'il vient à peine de naître.#Epicure","20180502");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (326,"Le système technicien","Je me rappelais que mon père avait coutume de dire que le but de la vie, c'est de se préparer à rester mort très longtemps.#William Faulkner","20170717");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (327,"L'établi","La fin de l'espoir est le commencement de la mort.#Charles de Gaulle","20170824");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (328,"Le langage du changement. Eléments de communication thérapeutique","Si je ne savais pas d'avance que je vais mourir un jour, si je n'étais pas certain de ne pas avoir tout le temps, je ne me soucierais pas de ma vie. Ce n'est donc pas la mort qui nous vient du temps, mais le temps qui nous vient de la mort.#Heidegger","20180117");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (329,"Contes et légendes inachevés Intégrale","Apprendre à voir la mort comme un compagnon invisible, mais amical dans le voyage de la vie. Qui vous rappelle doucement de ne pas remettre à demain ce que vous voulez faire. C'est apprendre à vivre sa vie plutôt qu'à la traverser.#Elisabeth Kübler-Ross","20180717");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (330,"Le bonheur conforme : Essai sur la normalisation publicitaire","La mort ne surprend point le sage : Il est toujours prêt à partir.#Jean de La Fontaine","20170429");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (331,"L'invention de la France: Atlas anthropologique et politique","Mais tu ne meurs pas de ce que tu es malade ; tu meurs de ce que tu es vivant.#Michel de Montaigne","20170613");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (332,"La société du risque : Sur la voie d'une autre modernité","Philosopher c'est apprendre à mourir.#Michel de Montaigne","20170510");
INSERT INTO bcf_comment (comment_id,comment_name,comment_text,comment_date) VALUES (333,"La barbarie","La perspective certaine de la mort pourrait mêler à la vie une goutte délicieuse et parfumée d’insouciance - mais, âmes bizarres d’apothicaires, vous avez fait de cette goutte un infect poison, qui rend répugnante la vie toute entière !#Nietzsche","20170302");
